import GameBoard from "./GameBoard"
import { React } from "react";

const game_board = new GameBoard()
const board = game_board.board
const piece = board[1][1]

class Button extends React.Component {

    constructor (props) {
        super()
        this.piece = piece
        this.HandlePiece = props.HandlePiece
        // const handlePiece = props.handlePiece
    }
    
    render () {
        return (
            <td className="color0" onClick={() => this.handlePiece(piece)}>{piece.let}</td>
        )
    }
}

// function Button (props) {
    
// }

export default Button
